    static public int lengthOfLongestSubstring(String s) {
        HashSet<Character> set = new HashSet<>();
        int n = s.length();
        if(n == 0) return 0;
        if(n == 1) return 1;
        // Our result will be stored in max.
        int max = 1;
        int index = 0;
        set.add(s.charAt(0));
        // Sliding Window Technique.
        for(int i=1;i<n;){
            char c = s.charAt(i);
            if(!set.contains(c)){
                set.add(c);
                max = Math.max(max,i - index + 1);
                i++;
            }else {
                set.remove(s.charAt(index));
                index++;
            }
        }
        return max;
    }

